import React, { Component } from 'react'
import VideoButtons from "../VideoButtons/VideoButtons";

export default class MainVideo extends Component {
    render() {
        <div className='videoPage__mainVideo'>

        <video
          // controls
          className="hero"
          poster={props.image}
          src={props.video}
        >
          <source type="video/mp4" />
        </video>
        <VideoButtons />

      </div>
    }
}
